    // Modify the SQL query to group tasks by category_id and count them
    $stmt = "
        SELECT
            t.category_id,
            COUNT(t.task_id) AS task_count,
            cg.customer_group AS category_name
        FROM
            tbl_task t
        LEFT JOIN
            tbl_customer_group cg ON t.category_id = cg.customer_group_id
