Here's a simple implementation of a math puzzle game in Python. This game will generate random addition and subtraction problems and award a point for each correct answer.

```python
import random

def generate_puzzle():
    num1 = random.randint(1, 10)
    num2 = random.randint(1, 10)
    operator = random.choice(['+', '-'])

    if operator == '+':
        answer = num1 + num2
    else:
        answer = num1 - num2

    puzzle = f"{num1} {operator} {num2}"
    return puzzle, answer

def main():
    print("Welcome to the Math Puzzle Game!")
    score = 0

    while True:
        puzzle, answer = generate_puzzle()
        print(f"\nSolve this puzzle: {puzzle}")

        while True:
            try:
                user_answer = int(input("Your answer: "))
                break
            except ValueError:
                print("Invalid input. Please enter a number.")

        if user_answer == answer:
            print("Correct! You earned a point.")
            score += 1
        else:
            print(f"Wrong! The correct answer is {answer}.")

        play_again = input("\nDo you want to try another puzzle? (yes/no): ")
        if play_again.lower() != 'yes':
            break

    print(f"\nYour final score is: {score}")
    print("Thanks for playing!")

if __name__ == "__main__":
    main()
```

